import Nav from 'react-bootstrap/Nav';

function Buttontabs() {
  return (
    <Nav fill variant="tabs" defaultActiveKey="/home">
      <Nav.Item>
        <Nav.Link href="/home">My Events</Nav.Link>
      </Nav.Item>
      <Nav.Item>
        <Nav.Link eventKey="link-1">Past Events</Nav.Link>
      </Nav.Item>      
    </Nav>
  );
}

export default Buttontabs;
